import { Route, Routes} from 'react-router-dom';
import Home from './Home';
import './App.css';
import Appbar from './components/Appbar';


function App() {
  return (
    <div>
    <Appbar />
    <Container className='body'>
    <Routes>
    <Route path ="/" element={<Home />} />
    </Routes>
    </Container>
    </div>
  );
}

export default App;
